import React, { Component } from 'react'
import './about.css';
import Navbar from '../navbar/Navbar';
import Footer from '../footer/Footer';

export class About extends Component {
    render() {
        return (
            <React.Fragment>
                <Navbar />
                <div className='about-page'>
                    <h3>About Us</h3>
                    <hr />
                    <div className='about-div'>
                        <p>Our team at General Discount Cleaning takes commitment to be industry leaders in innovation and achieving a higher level of standards in the cleaning industry. Networking with successful organizations to reach our goals of creating clean and Xquisit environments that we all share together. We build strong and trustworthy relationships with our customers where our team is motivated and driven to excel to their highest potential. We give our staff the tools, training and systems to help guide them to meet all expectations while staying true to our core values.</p>
                    </div>
                </div>
                <Footer />
            </React.Fragment>
        )
    }
}

export default About
